--
-- Name: stockline_stocktype_log ignore_duplicate_stockline_types; Type: RULE; Schema: public; Owner: steve
--

CREATE RULE ignore_duplicate_stockline_types AS
    ON INSERT TO public.stockline_stocktype_log
   WHERE ((new.stocklineid, new.stocktype) IN ( SELECT stockline_stocktype_log.stocklineid,
            stockline_stocktype_log.stocktype
           FROM public.stockline_stocktype_log)) DO INSTEAD NOTHING;


--
-- Name: stock log_stocktype; Type: RULE; Schema: public; Owner: steve
--

CREATE RULE log_stocktype AS
    ON UPDATE TO public.stock
   WHERE (new.stocklineid IS NOT NULL) DO  INSERT INTO public.stockline_stocktype_log (stocklineid, stocktype)
  VALUES (new.stocklineid, new.stocktype);


